import React from "react";

const Home = () => {
   return (
      <div>
         <header className="App App-content">
            <h1>This is the Home Page</h1>
         </header>
         <div className="App section">
            <div>
               <h3>
                  The future of Bid Scoping
               </h3>
            </div>
         </div>
      </div>
   );
};

export default Home;
